import React from 'react';
import logo from '../assets/Logo.svg'
import {Link} from "react-router-dom"

const Navbar = () => {
    return(
        <div>
            <Link to="/">
                <img src={logo} width={160} height={32} loading/>
            </Link>
        </div>  
    );
}

export default Navbar;
